import React from 'react';
import ButtonsBottom from '../components/ButtonsBottom';
import Logo from '../components/Logo';
import Navigation from '../components/Navigation';
import Widget from '../components/Widget';

const Presentation = () => {
    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo/>
                
                <div>
                    <img className="PP-Corentin" src="/assets/presentation/PP-CorentinR.png" alt="photo1" width="283" height="340"></img>
                    <img className="PP-Arnaud" src="/assets/presentation/PP-ArnaudM.png" alt="photo2" width="283" height="340"></img>
                 </div>
                <ButtonsBottom left={'/'} right={'/membres'} />
            </div>
        </main>
    );
};

export default Presentation;
